    # Find the party that Miguel Maura belongs to
    ?party a dbo:PoliticalParty ;
           dbo:leader ?leader .

    # Ensure the leader is a politician and find their office
    ?leader a dbo:Politician ;
            foaf:name "Miguel Maura" ;
            dbo:office ?officeLeader .

    # Find the force that involves Manuel Pinto da Costa as a commander
    ?force a dbo:MilitaryConflict, dbo:SocietalEvent ;
           dbo:commander ?commander .

    # Ensure the commander is an office holder and politician, find their office
    ?commander a dbo:Politician, dbo:OfficeHolder ;
               foaf:name "Manuel Pinto da Costa" ;
               dbo:office ?officeCommander .

    # Find the leader of the 2003 Madrid City Council election who is an office holder
    ?election dbo:leader ?councilLeader .

    FILTER (str(?election) = "http://dbpedia.org/resource/2003_Madrid_City_Council_election")

    # Ensure the council leader is an office holder and find their residence tenant
    ?councilLeader a dbo:OfficeHolder ;
                   foaf:name ?leaderName ;
                   dbo:residence ?residence .

    ?tenantResidence dbo:resident ?councilLeader .
}

