    ?child1 wdt:P31 wd:Q5;             # Person
            wdt:P22 wd:Q1234567.       # Parent (Alexander of Württemberg)

    # Step 2: Child of the child from step 1
    ?child2 wdt:P31 wd:Q5;
            wdt:P22 ?child1.

    # Step 3: Child of the child from step 2
    ?child3 wdt:P31 wd:Q5;
            wdt:P22 ?child2.

    # Ensure this third-level child is also a child of Archduchess Margarete Sophie of Austria
    ?child3Archduchess wdt:P31 wd:Q5;
                       wdt:P22 wd:Q2345678.  # Parent (Archduchess Margarete Sophie of Austria)

    FILTER(?child3 = ?child3Archduchess)

    # Step 4: Spouse of Archduchess Helena of Austria who is a royalty
    ?spouse wdt:P26 wd:Q3456789;       # Spouse (Archduchess Helena of Austria)
            wdt:P31/wdt:P279* wd:Q5.  # Royalty

    # Step 5: Child of this spouse
    ?childSpouse wdt:P31 wd:Q5;
                 wdt:P22 ?spouse.

    # The result should be a predecessor of the child from step 5
    ?result wdt:P31 wd:Q5;
            wdt:P22 ?child3;
            wdt:P1367 ?childSpouse.   # Predecessor (P1367 is a placeholder for actual property)
